import React, { useContext, useEffect } from 'react';
import './App.css';
import PlanetsContext from './PlanetsContext';
import Provider from './PlanetsProvider';
import Table from './Table';

function App() {
  const { fetchData } = useContext(PlanetsContext);

  useEffect(fetchData, []);

  return (
    <Provider>
      <Table />
    </Provider>
  );
}

export default App;
